import React, { Component } from 'react';
import './HeroBanner.css';

class HeroBanner extends Component {
  render() {
    const { onContactButtonClick } = this.props;

    return (
    <div className="neumorphic-hero-banner">
        <div className="content">
          <h1 className="title">Welcome to Our Website</h1>
          <p className="subtitle">Explore the possibilities!</p>
        <p>We are here to provide you with the best experience.</p>
      </div>
      <button className='scroll-button' onClick={onContactButtonClick}>Contact Us</button>
    </div>
    );
  }
}

export default HeroBanner;
